import React from "react";
import Sticker from "./Sticker";
import Price from './Price'
import Time from './Time'

function MainSticker(props){
  return(
    <div>
      <Sticker index={props.index}/>
      <Price/>
      <Time/>
    </div>
  )
}

export default Ma
